import React, { Component } from "react";
import { withRouter } from "react-router-dom";

class Payment extends Component {
  nextPath(path) {
    this.props.history.push(path);
  }

  render() {
    return (
      <div>
        <button onClick={() => this.nextPath("/")}>Submit</button>
      </div>
    );
  }
}

export default Payment;
